window.bookSummaryJSON = "<p><b><i>In a world where winning is everything, without each other, it means nothing.</i></b></p> <p>The first time I see Brody “Blink” Martin in the locker room, I fall hard.</p> <p>Big blue eyes, ripped abs…let’s just say there’s a reason the position is called tight end.</p> <p>But I’m Devlin “Devil” Summers—star quarterback, ladies’ man…and closeted.</p> <p>So I look but don’t touch.</p> <p>With the National Championship ours, I take a chance and kiss him.</p> <p>And when he kisses me back, I’m winning for the second time that night.</p> <p>From that moment on, we know we’re meant to be together.</p> <p>Different teams and schedules can’t keep us apart.</p> <p>Ten years later, we’re both playing for the Brooklyn Kings.</p> <p>Super Bowl champions.</p> <p>More in love than ever.</p> <p>Still hiding who we are.</p> <p>Then I’m forced to make the decision of a lifetime:</p> <p>Football or love.</p> <p>My end game is both.</p> <p><i>End Game is a they fall together MM romance that proves when you love someone, nothing and no one can keep you apart. It’s a big city/small town, hurt comfort, football romance with two big alpha men who are beasts against their opponents, but total mushes when it comes to each other.</i></p>"; 
